  \"[\"Access Constraints: None. | Use Constraints: *** Attribution *** nWhenever
  NMFS material is reproduced and re-disseminated, we request that users attribute
  the material appropriately.  Pursuant to 17 U.S.C. 403, parties who produce copyrighted
  works consisting predominantly of material created by the Federal Government are
  encouraged to provide notice with such work(s) identifying the U.S. Government material
  incorporated and stating that such material is not subject to copyright protection.
  Please cite Regulated Area datasets as follows, with the appropriate information
  substituted for all text in {CURLY BRACKETS}:NOAA Fisheries Service. NMFS Regulated
  Areas in Northeast and Mid-Atlantic Waters.  {SHAPEFILE TITLE} [Shapefile]. Gloucester,
  MA: National Oceanic and Atmospheric Administration (NOAA), National Marine Fisheries
  Service (NMFS), Greater Atlantic Regional Fisheries Office (GARFO) [producer] {SHAPEFILE
  PUBLICATION DATE}. http://www.greateratlantic.fisheries.noaa.gov/gis.n*** No Warranty***
  nThe user assumes the entire risk related to its use of these data. NMFS is providing
  these data \"as is,\" and NMFS disclaims any and all warranties, whether express
  or implied, including (without limitation) any implied warranties of merchantability
  or fitness for a particular purpose. No warranty expressed or implied is made regarding
  the accuracy or utility of the data on any other system or for general or scientific
  purposes, nor shall the act of distribution constitute any such warranty. It is
  strongly recommended that careful attention be paid to the contents of the metadata
  file associated with these data to evaluate dataset limitations, restrictions or
  intended use.  In no event will NMFS be liable to you or to any third party for
  any direct, indirect, incidental, consequential, special or exemplary damages or
  lost profit resulting from any use or misuse of this data.n*** Proper Usage ***
  nThe information on government servers are in the public domain, unless specifically
  annotated otherwise, and may be used freely by the public. Before using information
  obtained from this server, special attention should be given to the date and time
  of the data and products being displayed. This information shall not be modified
  in content and then presented as official government material. This dataset was
  created to depict the boundaries of NMFS Regulated Areas in Northeast and Mid-Atlantic
  Waters (Regulated Areas) only.  The dataset should not be used for a legal definition.
  \ The dataset should not be used to infer information regarding the existence or
  details of other marine features or resources, including, but not limited to, navigable
  waters, coastlines, bathymetry, submerged features, or man-made structures.  Users
  assume responsibility for determining the appropriate use of this dataset.n*** Not
  the Legal Definition *** nThis Geographic Information System (GIS) dataset is not
  the legal definition of the Regulated Area. The description published in the U.S.
  Code of Federal Regulations is the only legal definition.  This dataset and metadata
  document provide a broad overview of a subset of applicable fishing regulations,
  restrictions and requirements; it is not a substitute for the actual regulations.
  Users are encouraged to read the applicable regulations in conjunction with use
  of this dataset.  n*** Temporal Considerations *** nRegulated Area boundary definitions
  are subject to change or modification.  Published datasets may represent historic,
  current, or future Regulated Areas.  When changes to fishing regulations affect
  this dataset, it will be archived and replaced by an updated version as soon as
  feasible.  Approved Regulated Area boundaries may also be published prior to their
  effective date.  It is the useru2019s responsibility to ensure the applicable Regulated
  Area boundaries are being used.  n*** Shorelines/Base Layers *** nThe accuracy of
  this dataset is dependent upon the accuracy and resolution of the datasets (e.g.,
  shoreline, bathymetry, shared administrative boundaries) used in the creation process.
  Source datasets used are specified in the metadata.  These data sources were selected
  for their suitability to a broad audience, and may not be suitable for specific
  uses requiring higher-resolution information. Coastlines change.  Unless otherwise
  noted, where the NOAA Medium Resolution Shoreline is used, assume the regulatory
  boundary reaches the most current coastline delineation available.\"]\"\n\t},\n\t{\n\t\t\"key\":
